Most of the time, simply testing your smart contracts outputs isn't enough. To manipulate the state of the blockchain, as well as test for specific reverts and events, Foundry is shipped with a set of cheatcodes. Cheatcodes allow you to change the block number, your identity, and more. They are invoked by calling specific functions on a specially designated address: 0x7109709ECfa91a80626fF3989D68f67F5b1DD12D. If you are using ds-test, then this address is assigned in a constant named HEVM_ADDRESS. Let's write a test for a smart contract that is only callable by its owner. pragma solidity 0.8.10; import "ds-test/test.sol"; error Unauthorized(); contract OwnerUpOnly { address public immutable owner; uint256 public count; constructor() { owner = msg.sender; } function increment() external { if (msg.sender != owner) { revert Unauthorized(); } count++; }
} contract OwnerUpOnlyTest is DSTest { OwnerUpOnly upOnly; function setUp() public { upOnly = new OwnerUpOnly(); } function testIncrementAsOwner() public { assertEq(upOnly.count(), 0); upOnly.increment(); assertEq(upOnly.count(), 1); }
} If we run forge test now, we will see that the test passes, since OwnerUpOnlyTest is the owner of OwnerUpOnly. $ forge test
