Test result: ok. 2 passed; 0 failed; finished in 233.22µs Another cheatcode that is perhaps not so intuitive is the expectEmit function. Before looking at expectEmit, we need to understand what an event is. Events are inheritable members of contracts. When you emit an event, the arguments are stored on the blockchain. The indexed attribute can be added to a maximum of three parameters of an event to form a data structure known as a "topic." Topics allow users to search for events on the blockchain. pragma solidity 0.8.10; import "ds-test/test.sol"; interface CheatCodes { function expectEmit( bool, bool, bool, bool ) external;
} contract EmitContractTest is DSTest { event Transfer(address indexed from, address indexed to, uint256 amount); CheatCodes constant cheats = CheatCodes(HEVM_ADDRESS); function testExpectEmit() public { ExpectEmit emitter = new ExpectEmit(); // Check that topic 1, topic 2, and data are the same as the following emitted event. // Checking topic 3 here doesn't matter, because `Transfer` only has 2 indexed topics. cheats.expectEmit(true, true, false, true); // The event we expect emit Transfer(address(this), address(1337), 1337); // The event we get emitter.t(); } function testExpectEmitDoNotCheckData() public { ExpectEmit emitter = new ExpectEmit(); // Check topic 1 and topic 2, but do not check data cheats.expectEmit(true, true, false, false); // The event we expect emit Transfer(address(this), address(1337), 1338); // The event we get emitter.t(); }
} contract ExpectEmit { event Transfer(address indexed from, address indexed to, uint256 amount); function t() public { emit Transfer(msg.sender, address(1337), 1337); }
} When we call cheats.expectEmit(true, true, false, true);, we want to check the 1st and 2nd indexed topic for the next event. The expected Transfer event in testExpectEmit() means we are expecting that from is address(this), and to is address(1337). This is compared against the event emitted from emitter.t(). In other words, we are checking that the first topic from emitter.t() is equal to address(this). The 3rd argument in expectEmit is set to false because there is no need to check the third topic in the Transfer event, since there are only two. It does not matter even if we set to true. The 4th argument in expectEmit is set to true, which means that we want to check "non-indexed topics", also known as data. For example, we want the data from the expected event in testExpectEmit - which is amount - to equal to the data in the actual emitted event. In other words, we are asserting that amount emitted by emitter.t() is equal to 1337. If the fourth argument in expectEmit was set to false, we would not check amount. In other words, testExpectEmitDoNotCheckData is a valid test case, even though the amounts differ, since we do not check the data. 📚 Reference See the Cheatcodes Reference for a complete overview of all the available cheatcodes.

